/****** Object:  Table [dbo].[TS_DailyData]  ******/
SET ANSI_NULLS ON
GO


CREATE TABLE [dbo].[TS_DailyData]
(
	[Values_ID] [int]           NOT NULL IDENTITY(1,1),
	[Ticker]    [varchar](10)   NOT NULL,
	[Date]      [smalldatetime] NOT NULL,
	[Open]      [float]         NOT NULL,
	[High]      [float]         NOT NULL,
	[Low]       [float]         NOT NULL,
	[Close]     [float]         NOT NULL,
	[Volume]    [bigint]        NULL,
    CONSTRAINT [PK_TS_Values] PRIMARY KEY CLUSTERED ([Values_ID] ASC),
	CONSTRAINT [UK_TS_Values] UNIQUE ([Ticker], [Date])
)  

GO
  
DECLARE @Howmany AS INT
SELECT @Howmany = COUNT(*) FROM TS_DailyData
IF @Howmany > 0 
	DELETE FROM TS_DailyData;

